detailed-desc.p:
When R4 is the optionally substituted secondary or tertiary amine attached to the C Ring through the secondary or tertiary amine N, R4 may further comprise a primary or secondary amine, wherein the primary or secondary amine is not directly attached to the C Ring. “Primary amine” refers to an amine group that contains two H atoms attached to the primary amine N when attached to the remainder of the substituent. With respect to the “secondary amine” that is not directly attached to the C Ring, in this instance, the secondary amine refers to an amine group that contains one H atom attached to the secondary amine N when attached to the remainder of the substituent. The primary or secondary amine that is not directly attached to the C Ring may be positioned in the compound in the bound conformation wherein:
a) the distance between the C or N atom of Y and the primary or secondary amine N is about 7 Å to about 10.5 Å;
b) the distance between the C atom to which R8 is attached and the primary or secondary amine N is about 6 Å to about 9 Å;
c) the distance between the C atom to which R4 is attached and the primary or secondary amine N is about 3.5 Å to about 6 Å; and
d) the distance between the C atom to which R2 is attached and the primary or secondary amine N is about 5 Å to about 7.5 Å.

